drop table IF EXISTS sequence;
CREATE TABLE IF NOT EXISTS `sequence` (  
  `name` varchar(50) NOT NULL,  
  `current_value` bigint NOT NULL,  
  `increment` bigint NOT NULL DEFAULT '1'  
) ENGINE=MyISAM DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;  
  
DROP FUNCTION IF EXISTS `currval`;  
DELIMITER //
CREATE  FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS bigint  
    READS SQL DATA  
    DETERMINISTIC
BEGIN  
DECLARE VALUE BIGINt;  
SET VALUE = 0;  
SELECT current_value INTO VALUE FROM sequence WHERE NAME = seq_name;  
RETURN VALUE;  
END//  
DELIMITER ;

DROP FUNCTION IF EXISTS `nextval`;    
DELIMITER //  
CREATE  FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS bigint 
    DETERMINISTIC  
BEGIN  
UPDATE sequence SET current_value = current_value + increment WHERE NAME = seq_name;  
RETURN currval(seq_name);  
END//
DELIMITER ;

-- init sequence

 
select nextval(date_format(sysdate(), '%Y%m%d'));
select currval(date_format(sysdate(), '%Y%m%d'));